So the dependencies spin or lazy_static is not necessary here: // define the message
pub struct Msg(String); // impl the Message trait
impl message::Message for Msg {} impl Actor for Writer { type Message = Msg; // normally create the Writer fn create(_: &mut Context<Self>) -> Self { Writer { column_position: 0, color_code: ColorCode::new(Color::Yellow, Color::Black), buffer: unsafe { &mut *(0xb8000 as *mut Buffer) }, } } // this line is not necessary though // a syntax must // // since we dont use an writer instance then // call this method fn action(&mut self, _: Self::Message, _: &mut Context<Self>) {}
} According to the illustration above, once the actor is created, you can access it as glocal static item, and downcast it to the original type Writer, and you don't manually lock the Writer ( crossbus has assure its exclusively access) // mark the writer's actor id
// used to get writer from `crossbus::Register`
static WRITERID: AtomicUsize = AtomicUsize::new(0); // if Writer is not created
// then create one
if WRITERID.load(Ordering::Acquire) == 0 { let (_, id) = Writer::start(); WRITERID.store(id, Ordering::Release);
} // find the actor by id and
Register::get(WRITERID.load(Ordering::Acquire)) .unwrap() // downcast the actor as mutable reference of Writer .downcast_mut::<Writer, _>( // here pass a closure, // writer is a mutable reference |writer: &mut Writer| { // and use it write string to display writer.write_fmt(args).unwrap(); Ok(()) }, );

